import _ from "lodash";
import React from "react";

const Paginate = (items, pageNumber, pageSize) => {
  const startIndex = (pageNumber - 1) * pageSize;

  _(items).slice(startIndex).take(pageSize).value();

  return <div></div>;
};

export default Paginate;
